import './style.css'

const MovieCards=({ name, url, category, duration })=> {
    return (
        
            <div className="cards">
                <img src={url} className="poster" alt="poster" />
                <img src={url} alt="poster" className='poster-img' />
                <h3>{name}</h3>
                <h4>Category: {category}</h4>
                <h4>Duration:{duration}</h4>
            </div>
        
    )
}
export default MovieCards;
